INSERT INTO `base_target_gift` (`day`, `name`, `time_limit`, `target`, `gift`, `gift_certificate`, `explanation`, `tip`) VALUES
(1, '梦回远古', 0, '选择部落', '[[22000,3]]', 20, '经脉成长符可以提升经脉灵根等级，提升灵根后经脉的加成效果会更加显著。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(2, '一骑绝尘', 0, '当前坐骑强化到+3', '[[21100,3],[21200,6]]', 40, '低阶锋芒灵石，可以在法宝、坐骑强化1-3时使用。低阶坚韧灵石可以在防具强化1-3级时使用。点击主界面右上方的炼器按钮可使用装备强化功能。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(3, '锋芒毕露', 0, '攻击力到达500', '[[21001,3],[21002,1]]', 60, '蓝色鉴定石，可用于鉴定蓝色装备，获得蓝色鉴定属性。金色鉴定石，可用于鉴定金色装备，获得金色鉴定属性。点击主界面右上方的炼器按钮可以使用装备鉴定功能。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(4, '血脉觉醒', 0, '气血达到3500', '[[21330,1],[21401,1]]', 80, '1级防御石，可镶嵌在腰带，鞋子，裤子和衣服上，增加角色的防御力。中阶打孔石，可用于金色法宝和防具的打孔。点击主界面右上方的炼器按钮可使用装备强化功能。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(5, '众志成城', 0, '帮派等级3级 帮贡达到500', '[[21101,3],[21201,3],[20200,3],[23402,2]]', 100, '中阶锋芒灵石，可以在法宝、坐骑强化4-6时使用。中阶坚韧灵石可以在防具强化4-6级时使用。低级镶嵌符，提高1-3级宝石镶嵌的25%成功率。点击主界面右上方的炼器按钮可使用装备强化功能和宝石镶嵌功能。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(6, '神兵利器', 0, '提升当前武器到+6', '[[20300,8]]', 120, '幸运符，增加装备强化成功率5%', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(7, '金刚护体', 0, '提升衣服强化到+6', '[[21202,1],[21102,1],[23006,1]]', 140, '高阶锋芒灵石，可以在法宝、坐骑强化7-10时使用。高阶坚韧灵石，可以在防具强化7-10级时使用。点击主界面右上方的炼器按钮可使用装备强化功能。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(8, '易经伐髓', 0, '奇脉达到6级，灵根到5级', '[[22007,1],[22000,3],[20100,3]]', 160, '经脉保护符，可使经脉强化失败后不会掉级，经脉成长符可以提升经脉灵根等级。低级合成符，可用于镶嵌宝石合成，将低级宝石合成为高级宝石。点击主界面右上方的炼器按钮可使用宝石合成功能', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(9, '飞龙在天', 0, '出战灵兽达到16级以上  资质达到30以上', '[[24401,1],[24400,8],[24000,15]]', 180, '灵兽保护符，可使灵兽资质强化失败后不会掉级，灵兽资质符可用于提升灵兽资质。灵兽口粮可提升灵兽的快乐值。', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。'),
(10, '雄霸天下', 0, '角色等级达到40级', '[[21320,1],[21300,1],[20000,4],[23106,1]]', 200, '1级攻击宝石，可镶嵌在法宝、护腕、护手上，增加角色的攻击力，1级气血宝石，可镶嵌在腰带、鞋子、裤子和衣服上，增加角色的气血。低级摘除符，可提高镶嵌在装备上的宝石摘除的成功率', '前期可以通过完成主线任务、副本任务、氏族任务快速升级，后期可以组队完成运镖、跑商快速升级，别忘记下线前要去进行离线挂机哦。');
